import React, { Component } from 'react';
import './App.css';
import { Connector } from 'mqtt-react';

import _MessageContainer from './mqtt/MessageContainer';
import { subscribe } from 'mqtt-react';


const _MessageList = (props) => (
  <p>
    Button Clicked: {props.data}
  </p>
);

// simple subscription to messages
const MessageList = subscribe({
  topic: 'restaurant/buttons'
})(_MessageList)

class App extends Component {


  render() {
    console.log(_MessageList);
    return (
      <Connector mqttProps="ws://192.168.100.103:12345/">
        <div className="App">
          <div className="App-header">
          </div>
          <MessageList/>
        </div>
      </Connector>
    );
  }
}

export default App;
